import React from 'react';
import AppointmentRequest from '../component/AppointmentRequest';
import PatientChart from '../component/PatientChart';
import GenderChart from '../component/GenderChart';

const HomePage = () => {
  return (
    <div className="bg-gray-200 h-screen w-screen">
      <div>
        <div classNAme="bg-white w-[326px]">

        </div>
        <div className="flex">
          <AppointmentRequest/>
          <div className="ml-[39px]">
            <PatientChart/>
            <div className="mt-28">
              <GenderChart />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};


export default HomePage;
